            <div className="w-full h-full">
                <Link to={"/result/madrasa/1"}>
                    <button
                        type="button"
                        onClick={""}
                        className="text-center text-xl text-white font-bold h-[7%] w-[94%] mt-5 bg-blue-600 hover:text-blue-300 p-4 border rounded-md ml-3 mr-3"
