                </button>


            </div>
            <div className="w-[60%] h-[80%]  ml-10 mt-20 bg-gray-100">
                <div className="w-[50%] ml-56 mt-40">{showRoll}</div>
                <div className="w-[50%] ml-56 mt-40">{showMadrasa}</div>
